import fetcher from '../fetcher';

const getUsersById = async (email, password) => {
    try{
        const {data} = await fetcher.post('/login', {email, password});
        return data;
    }catch(error){
        console.log(error);
    }
}

const getImagesByApartmentId = async (apartmentId) => {
    try {
        const {data} = await fetcher.get(`/images/${apartmentId}`);
        return data
    } catch(error){
        console.log(error)
    }
} 

export {getImagesByApartmentId};
